import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';

let postsDt = [
  {id: 1, message: 'Hi, how are u?', likes: 12},
  {id: 2, message: 'Hi, everybody!', likes: 36},
  {id: 3, message: 'OK. And u?', likes: 26}
]

/*const root = ReactDOM.createRoot(document.getElementById('root'));

root.render(
  <React.StrictMode>
